import React from "react";
import { ListItem } from "./ListItem";

export const List = ({ todos, visibleTodos }) => {
  return (
      todos.length > 0 ? (
          <ul>
          visibleTodos.map((todo) => <ListItem todo={todo} key={todo.id}/>)
          </ul>
      ) : (
          <div className="noneTodo">No records found</div>
      )
  )
}
